        <Head>
            <title>BitzPrice</title>
            <link rel="stylesheet" 
            href="https://bootswatch.com/4/Darkly/bootstrap.min.css"
            />
        </Head>
        <Navbar/>
        <div className="container">
        {props.children}
        </div>
    </div>
);

export default Layout;
